#include <climits>

#include "../header.h"

#include "lib/segmentTree.h"

class Solution {
   public:
    int constrainedSubsetSum(const vector<int>& nums, int k) {
        const int n = nums.size();
        using IntVector = std::vector<int>;
        IntVector dp = nums;

        SegmentTree<int, Max<int>> rmq(n);
        for (int i = 0; i < n; ++i) {
            rmq.set(i, dp[i]);
        }

        for (int i = 0; i < n; ++i) {
            int mx = rmq.getAggr(max(0, i - k), i);
            dp[i] = max(nums[i] + mx, dp[i]);
            rmq.set(i, dp[i]);
        }
        return *max_element(dp.begin(), dp.end());
    }
};

